    [],nt"revision_timestamp": "2016-07-27T23:02:03.496665",nt"name": "investigations-of-interior-arctic-coastal-plain-avifauna-in-national-petroleum-reserve-of-",nt"isopen":
    false,nt"url": null,nt"notes": "This document covers the investigations
    of interior Arctic coastal plains avifauna in national petroleum reserve of Alaska.
    The effects of petroleum development on water birds and their wetland resources
    were studied at Singiluk on the interior Arctic Coastal Plain of National Petroleum
    Reserve Alaska from June to August 1977. Species discussed include Longspurs, Pectoral
    Sandpipers, Oldsquawa, Pintails and White-fronted geese. Vegetation and invertebrates
    were also studied to determine the food habits of avian species in the southern
    portion of the Alaska Arctic Coastal Plain.",nt"license_title": "License Not
